import React,{Component} from 'react'
import Timer from './Timer'

class App3 extends Component {
    render(){
    return (
        <div>
        <h2>Welcome to Timer App</h2>
            <Timer start1={Date.now()}></Timer>
        </div>
    )
    }
}

export default App3
